public String[] getStorageIDs() {
  if(!hasStorageIDs) {
    return null;
  }
  if(storageIDs != null) {
    return storageIDs;
  }
  storageIDs = new String[locs.length];
  for(int i = 0; i < locs.length; i++) {
    storageIDs[i] = locs[i].getStorageID();
  }
  return storageIDs;
}
